// Wait for Third-Party Risk Management element to be visible and click it
cy.xpath("//p[contains(@class,'custom-slider-desc')][normalize-space()='Third-Party Risk Management']").should('be.visible').click();
cy.wait(5000);
// Expand the navbar
cy.get('button.e-control.e-btn.e-lib.btn-toggle').as('toggleBtn').should('be.visible').click();
cy.wait(4000);
// Navigate to Assessment Template
cy.xpath("//span[normalize-space()='Assessment Template']").should('exist').should('be.visible').click();
// Click on Create Template
cy.xpath("//a[normalize-space()='Create Template']").click();
// Handle the modal for template creation
cy.get('div[class*="custom-modal"]').each($modal => {
  cy.wrap($modal).within(() => {
    cy.get('input#TemplateName').should('be.empty').type('Test Template Name');
    // Select dropdown option for Outcome Type
    cy.get('input#OutcomeTypeId').parent().click();
    cy.get('ul[role="listbox"] li').contains('Satisfactory/Non-satisfactory').click({
      force: true
    });
    // Click the Create button
    cy.get('button.e-primary').contains('Create').click();
    cy.wait(5000);
    // Verify template is added
    cy.get('table', {
      timeout: 10000
    }).should('be.visible');
    cy.get('table tbody tr', {
      timeout: 10000
    }).should('have.length.at.least', 1);
    cy.contains('td', 'Test Template Name', {
      timeout: 10000
    }).should('be.visible').parent().within(() => {
      cy.get('span#template-ToolTip').should('have.text', 'Test Template Name');
    });
  });
});
